import React from 'react';
import './login.css';

const login = (props) => {
    return(
        <div id="container">
        <label htmlFor="uname">
          <b>Username :</b>
        </label>
        <input
          type="text"
          placeholder="Enter Username"
          name="uname"
          onChange={props.updatedUsername}
        />

        <label htmlFor="psw">
          <b>Password :</b>
        </label>
        <input
          type="password"
          placeholder="Enter Password"
          name="psw"
          onChange={props.updatedpassword}
        />

        <button type="submit" onClick={props.click}>
          Login
        </button>
      </div>
    );
}

export default login;
